{"query":"mutation ($userId: UUID4!, 
        $startDate: String!,
        $endDate: String!) {
    createTraining(input: {
        userId: $userId
        startDate: $startDate
        endDate: $endDate
        exercises: [
            {
                name: "Triceps Banco"
                protocolDescription: "drop-set"
                repetitions: "3x15"
                youtubeVideoUrl: "www.youtube.com"
            }, 
            {
                name: "Triceps Corda"
                protocolDescription: "regular"
                repetitions: "4x8"
                youtubeVideoUrl: "www.youtube.com"
            }
        ]
    }) {
        exercises {
            name
            protocolDescription
            repetitions
            youtubeVideoUrl
        }
        startDate
        endDate
    }
}","variables":{"userId":"{% response 'body', 'req_ea401a55f001461a9a7f829ad258c039', 'b64::JC5kYXRhLmNyZWF0ZVVzZXIuaWQ=::46b', 'when-expired', 300 %}","startDate":"{% now 'custom', 'YYYY-MM-DD' %}","endDate":"{% customTimestamp 'add', '', '', '5', '', '', '', '', 'custom', 'YYYY-MM-DD', '' %}"}}

{"query":"mutation ($randomEmail: String!){
        createUser(input: {
        name: "Allan Presotto",
        email: $randomEmail
        password: "12345678"
    }){
        id
        name
    }
}","variables":{"randomEmail":"{% hash 'sha1', 'hex', '' %}@gmail.com"}}

{"query":"query ($userId: UUID4!) {
  getUser(id: $userId) {
    email
    id
    name
  }
}","variables":{"userId":"{% response 'body', 'req_ea401a55f001461a9a7f829ad258c039', 'b64::JC5kYXRhLmNyZWF0ZVVzZXIuaWQ=::46b', 'when-expired', 300 %}"}}
